document.onmouseup = function (evt) {
	var draggingColor = SurveoThemeGenerator.draggingColor;
	var elementOfDrop = document.elementFromPoint(evt.pageX, evt.pageY);
	var defaultPropConts = document.getElementsByClassName("defaultPropCont");
	var input = "";
	var background = "";
	var leftPanelElement = "";
	var optionArray = "";
	var radio = "";
	SurveoThemeGenerator.draggingColor = null;
	if(draggingColor !== null) {
		background = draggingColor.style[SurveoThemeGenerator.getSourceProperty(draggingColor)];
		draggingColor.style.display = "none";
		elementOfDrop = SurveoThemeGenerator.findNearestChangeableClass(elementOfDrop);
		if (elementOfDrop) {
			optionArray = elementOfDrop.getAttribute("name").split("_");
			input = SurveoThemeGenerator.setAndGetFocusOn(optionArray[1]);
			SurveoThemeGenerator.setStyleToElements(optionArray[1], background, elementOfDrop, true);
			SurveoThemeGenerator.setBackgroundToAllFields(input, draggingColor, optionArray, true);
		}
	}
	if (SurveoThemeGenerator.inspector) {
		elementOfDrop = SurveoThemeGenerator.findNearestChangeableClass(elementOfDrop);
		SurveoThemeGenerator.clearInspector();
		if (elementOfDrop) {
			optionArray = elementOfDrop.getAttribute("name").split("_");
			if (SurveoThemeGenerator.isSurveoSnippet(optionArray[0])) {
				leftPanelElement = document.getElementById("surveoSnippets");
			} else {
				//leftPanelElement = document.getElementById(optionArray[0]);
				leftPanelElement = document.getElementById("surveoGenericSlide");
			}
			var index = SurveoThemeGenerator.getSubContainerOf(leftPanelElement.id);
			if (defaultPropConts[index].offsetHeight == 0) {
				SurveoThemeGenerator.setParametersOptions(leftPanelElement);
				setTimeout(function() {
					input = SurveoThemeGenerator.setAndGetFocusOn(optionArray[1]);
				}, 300);
			} else {
				input = SurveoThemeGenerator.setAndGetFocusOn(optionArray[1]);
			}
			SurveoThemeGenerator.setBackgroundToAllFields(input, draggingColor, optionArray, true);
		}
	}
};

document.onmousemove = function (evt) {
	var draggingColor = SurveoThemeGenerator.draggingColor;
	var x = evt.pageX;
	var y = evt.pageY;
	if(draggingColor !== null && x > -1 && y > -1 && x < document.body.offsetWidth && y < document.body.offsetHeight) {
		draggingColor.style.left = (x - draggingColor.offsetWidth / 2) + "px";
		draggingColor.style.top = (y - draggingColor.offsetHeight) + "px";
	}
	if (SurveoThemeGenerator.inspector) {
		var hoverElement = document.elementFromPoint(x, y);
		hoverElement = SurveoThemeGenerator.findNearestChangeableClass(hoverElement);
		SurveoThemeGenerator.clearInspector();
		if (hoverElement) {
			hoverElement.style.boxShadow = "#EA0 0px 0px 15px 3px inset";
		}
	}
};

document.ondrop = function (evt) {
	evt.preventDefault();
};

document.ondragover = function (evt) {
	evt.preventDefault();
};

document.onkeydown = function (evt) {
	if (evt.ctrlKey) {
		switch (evt.keyCode) {
			case 73:
				evt.preventDefault();
				var button = document.getElementsByClassName("buttonsContainer")[4];
				SurveoThemeGenerator.changeInspectorStatus(button);
				break;
			case 79:
				evt.preventDefault();
				SurveoThemeGenerator.getThemesFromCMS(true);
				break;
			case 83:
				evt.preventDefault();
				SurveoThemeGenerator.saveConfirm();
				break;
			case 89:
				evt.preventDefault();
				SurveoThemeGenerator.redoLastChange();
				break;
			case 90:
				evt.preventDefault();
				SurveoThemeGenerator.undoLastChange();
				break;
			default:
				return;
			break;
		}
    }
	if (evt.keyCode === 27 && SurveoThemeGenerator.escActive) {
		var tourDivsContainer = document.getElementById("tourDivsContainer");
		if (tourDivsContainer) {
			document.body.removeChild(tourDivsContainer);
			SurveoThemeGenerator.setParametersOptions();
			SurveoThemeGenerator.tourObject.text = [];
			SurveoThemeGenerator.tourObject.element = [];
			SurveoThemeGenerator.escActive = false;
			clearTimeout(SurveoThemeGenerator.tourObject.timeOut);
		} else if (SurveoThemeGenerator.currentThemeGUID !== "" && SurveoThemeGenerator.renameNotInProgress) {
			evt.preventDefault();
			SurveoThemeGenerator.zoomOut("themeExplorer");
			SurveoThemeGenerator.animateMaskDiv(500);
			SurveoThemeGenerator.escActive = false;
		}
	}
};

