		"changeBGPosition" : function (radioBtn) {
			var position = "";
			var leftPanel = SurveoThemeGenerator.activeLeftPanelElem;
			if (leftPanel === "surveoSnippets") {
				leftPanel = SurveoThemeGenerator.activeSnippet;
			}
			if (radioBtn.name.match(/Header background|Content background|Body Font Color/)) {
				leftPanel = "surveoContainer";
			}
			var name = leftPanel +  "_" + radioBtn.name;
			var changeElements  = document.getElementsByName(name);
			var changeElementsLength = changeElements.length;
			switch (radioBtn.value) {
				case "stretch":
					position = " center no-repeat; background-size: 100% 100%";
					for (var k = 0; k < changeElementsLength; k++) {
						changeElements[k].style.backgroundPosition = "center";
						changeElements[k].style.backgroundSize = "100% 100%";
						changeElements[k].style.backgroundRepeat = "no-repeat";
					}
					break;
				case "center":
					position = " center no-repeat; background-size: initial";
					for (var k = 0; k < changeElementsLength; k++) {
						changeElements[k].style.backgroundPosition = "center";
						changeElements[k].style.backgroundSize = "initial";
						changeElements[k].style.backgroundRepeat = "no-repeat";
					}
					break;
				case "tile":
					position = " center repeat; background-size: initial";
					for (var k = 0; k < changeElementsLength; k++) {
						changeElements[k].style.backgroundPosition = "center";
						changeElements[k].style.backgroundSize = "initial";
						changeElements[k].style.backgroundRepeat = "repeat";
					}
					break;
				default:
					return;
			}
			SurveoThemeGenerator.posRepSize[name] = position;
		},

