		"doesNotArrayContains" : function (arr, val) {
			var len = arr.length;
			if (len > 0) {
				while (len--) {
					if (arr[len] == val) {
						return false;
					}
				}
			}
			return true;
		},

		"dropPuctureFunction" : function (evt, canvas) {
			evt.preventDefault();
			var urlImage = evt.dataTransfer.getData('URL');
			if (urlImage != "") {
				// SurveoThemeGenerator.URLtoBase64(unescape(urlImage).match(/imgurl\=(.*)\&imgrefurl/)[1]);	//google images
				SurveoThemeGenerator.animateMaskDiv(0);
				setTimeout(function () {
					SurveoThemeGenerator.URLtoBase64(urlImage);
				}, 100);
			} else {
				var files = evt.dataTransfer.files;
				SurveoThemeGenerator.fileReaderFunction(files, 0, canvas);
			}
			evt.target.src = "data:image/png;base64,";
		},

		"fileReaderFunction" :  function (files, index, canvas) {
			if (index < files.length) {
				var reader = new FileReader();
				var file = files[index];
				if (typeof FileReader !== "undefined" && file.type.indexOf("image") !== -1) {
					reader.readAsDataURL(file);
					reader.onload = function (evt) {
						SurveoThemeGenerator.fileReaderArray.push(reader.result);
						index++;
						SurveoThemeGenerator.fileReaderFunction(files, index, canvas);
					}
				}
			} else {
				if (canvas) {
					var themeImage = document.getElementById("themeImageID");
					themeImage.src = SurveoThemeGenerator.fileReaderArray[0];
					SurveoThemeGenerator.theme.themeImage = "url('" + SurveoThemeGenerator.fileReaderArray[0] + "')";
					SurveoThemeGenerator.notDefaultImage = true;
				} else {
					SurveoThemeGenerator.addPictureToStore(SurveoThemeGenerator.fileReaderArray);
				}
				SurveoThemeGenerator.fileReaderArray = [];
			}
		},

		"findNearestChangeableClass" : function (element) {
			if (element) {
				while (element.className.indexOf("changeableBackgroundClass") < 0) {
					element = element.parentNode;
					if (element.tagName == "BODY" || element.tagName == "body") {
						return false;
					}
				}
				return element;
			}
		},

		"getBase64sFromTheme" : function (themeObject) {
			var base64Array = [];
			var base64ArrayLen = 0;
			var newArray = [];
			var val = "";
			var fullName = "";
			for (var outProp in themeObject) {
				if (themeObject[outProp] !== null && typeof themeObject[outProp] === "object") {
					for (var inProp in themeObject[outProp]) {
						fullName = outProp + "_" + inProp;
						val = themeObject[outProp][inProp];
						if (val !== null) {
							if (inProp == "Default Question Template") {
								val = SurveoThemeGenerator.splitAndSetDefaultQuestionTemplate(val);
								base64Array = base64Array.concat(val);
							} else {
								if (val.indexOf("data:image") > -1) {
									SurveoThemeGenerator.setPosRepSize(val, fullName);
									val = SurveoThemeGenerator.makeLegalSource(val, fullName);
									base64Array.push(val);
								}
							}
						}
					}
				}
			}
			base64ArrayLen = base64Array.length;
			for (var i = 0; i < base64ArrayLen; i++) {
				if (SurveoThemeGenerator.doesNotArrayContains(newArray, base64Array[i])) {
					newArray.push(base64Array[i])
				}
			}
			return newArray;
		},

