		"getHTMLForPropertiesCont" : function (param) {
			var visualObject = SurveoThemeGenerator.theme[param];
			var html = [];
			var positionBGs = ["stretch", "center", "tile"];
			if (SurveoThemeGenerator.isSurveoSnippet(param)) {
				visualObject = SurveoThemeGenerator.theme;
				html.push('<select class="selectClass interfaceSelect" onchange="SurveoThemeGenerator.chooseSnippet(this)">');
				html.push('<option selected="selected">surveoQuestionEmpty</option>');
				html.push('<option>surveoStartSlide</option>');
				for (var prop in visualObject) {
					if (SurveoThemeGenerator.isSurveoSnippet(prop)) {
						if (prop == SurveoThemeGenerator.activeSnippet) {
							html.push('<option selected="selected">');
						} else {
							html.push('<option>');
						}
						html.push(prop);
						html.push('</option>');
					}
				}
				html.push('</select>');
				visualObject = SurveoThemeGenerator.theme[SurveoThemeGenerator.activeSnippet];
			}
			if (visualObject) {
				var temp = "";
				html.push('<table class="tableCalss"><tbody>');
				if (param === "surveoGenericSlide") {
					html.push(SurveoThemeGenerator.inputsForQueastionTemplate());
				}
				for (var prop in visualObject) {
					if (SurveoThemeGenerator.notDisabled(param, prop)) {
						html.push('<tr><td>');
						html.push(prop);
						html.push('</td><td>');
						if (visualObject[prop] == null || visualObject[prop] == "") {
							temp = "N/A";
						} else {
							temp = visualObject[prop];
							if (temp in SurveoThemeGenerator.base64Store) {
								temp = SurveoThemeGenerator.base64Store[temp];
							}
						}
						html.push('<textarea class="iterfaceTextarea" name="' + prop + '" ');
						html.push('onclick="SurveoThemeGenerator.selectText(this)" onkeypress="SurveoThemeGenerator.ifEnterPressed(this, event)" onchange="SurveoThemeGenerator.changeStyleFromLeftPanel(this)" ');
						html.push('title="' + SurveoThemeGenerator.getTitle(prop) + '">');	
						html.push(temp + '</textarea>');
						if (SurveoThemeGenerator.isChangeableBackground(param, prop)) {
							for (var g = 0; g < 3; g++) {
								html.push('<div class="radioInput" onclick="SurveoThemeGenerator.radioLabelClick(this)">');
								html.push('<input type="radio" name="' + prop + '"');
								if (positionBGs[g] == SurveoThemeGenerator.getRadioBtnValue(param + "_" + prop)) {
									html.push('checked="true"');
								}
								html.push('value="' + positionBGs[g] + '">' + positionBGs[g]);
								html.push('</div>');
							}
						}
						html.push('</td></tr>');
					}
				}
				html.push('</tbody></table>');
			}
			return html.join('');
		},

