		"makeLegalSource" : function (string) {
			if (typeof string === "undefined") {
				return;
			}
			var temp = string.split("url(")[1];
			if (temp && temp.length > 1) {
				if (temp[0] === "'") {
					string = string.match(/('(.*)')/)[0];
				} else if (temp[0] === '"') {
					string = string.match(/("(.*)")/)[0];
				} else {
					string = temp.substring(0, temp.length - 1);
				}
			}
			string = string.replace(/'|"/g, "");
			return string;
		},

