		"setThemeObject" : function (options, property) {
			if (property.indexOf("data:image") > -1) {
				property = "url('" + SurveoThemeGenerator.makeLegalSource(property) + "')";
			}
			if (options[0] === "surveoContainer" && options[1] === "Header Font Color") {
				SurveoThemeGenerator.theme.surveoGenericSlide["Header Font Color"] = property;
			}
			switch (true) {
				case (options[1] === "Header background" || options[1] === "Content background" || options[1] === "Default Question Template"):
					SurveoThemeGenerator.setDefaultQuestionTemplate(property, options[1]);
					break;
				case (property == "" || property == "N/A"):
					SurveoThemeGenerator.theme[options[0]][options[1]] = null;
					break;
				default:
					SurveoThemeGenerator.theme[options[0]][options[1]] = property;
					break;
			}
		},

