		"stringifyTheme" : function () {
			var outputString = [];
			var picBase64 = "";
			var lastValue = "";
			var id = "";
			outputString.push('(function(){ ');
			for (var l = 0; l < SurveoThemeGenerator.base64Counter; l++) {
				id = 'picID_' + l;
				picBase64 = SurveoThemeGenerator.base64Store[id];
				picBase64 = escape(picBase64);
				outputString.push('var ' + id + ' = "' + picBase64 + '";');
			}
			outputString.push('var theme={ ');
			for (var outProp in SurveoThemeGenerator.theme) {
				outputString.push('"' + outProp + '":');
				if (typeof SurveoThemeGenerator.theme[outProp] === "object") {
					outputString.push('{');
					for (var inProp in SurveoThemeGenerator.theme[outProp]) {
						lastValue = SurveoThemeGenerator.theme[outProp][inProp];
						outputString.push('"' + inProp + '":');
						if (lastValue != null) {
							if (inProp == "Default Question Template") {
								outputString.push('"' + SurveoThemeGenerator.getReadyTemplate().replace(/\|/g, '\\"') + '",');
							} else if (lastValue.indexOf("data:image") > -1 && !lastValue.match("data:image/png;base64,R0lGODlhAQABAIAAAAAAAP///yH5BAEAAAAALAAAAAABAAEAAAIBRAA7")) {
								outputString.push('unescape(' + SurveoThemeGenerator.getPictureID(lastValue) + ')' + SurveoThemeGenerator.getPosRepSize(outProp + "_" + inProp) + ',');
							} else {
								outputString.push('"' + lastValue + '",');//.replace(/"/g, '\\"') + '",');
							}
						} else {
							outputString.push(null + ',');
						}
					}
					outputString.push('},');
				} else {
					if (outProp == "themeImage") {
						outputString.push('"' + SurveoThemeGenerator.theme[outProp] + '; background-size: 100% 100%;",');
					} else {
						outputString.push('"' + SurveoThemeGenerator.theme[outProp] + '",');
					}
				}
			}
			outputString.push('};return theme;})();');
			return outputString.join('');
		},

